B.Pz=new A.bz("To reset the map at any point, tap the the first icon in the bottom navigation bar (the compass icon). This will remove any highlights from any previously selected tag or artist. Tappable stalls on the map are shown with a slight purple colour. Black stalls are unregistered with this app.\n\n",null,null,B.z,null,null)
